          <Comment userId="Wadcharakorn_SE" message="Wow, it's wonderfull"/>
          <Comment userId="Mr.Unkhown" message = "Congratulation !"/>
      </Post>

      <Card/>
      <Navbar/>
    </div>
  );
}

export default App;
